import { ApiItems } from '../api/types';
export interface V3ResponseMeta {
    code: number;
    message: string;
    serverTime: Date;
    userTimezone: {
        name: string;
        offset: string;
    };
}
export interface V3ApiRef {
    href: string;
    id: string;
    resourceType: string;
}
export interface V3ApiResponse<T> {
    meta: V3ResponseMeta;
    response: T;
}
export type V3List<T> = ApiItems<T>;
